import React, { useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const CreateUserForm = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [imgPath, setImgPath] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:8080/Auth/save', {
        idU: '',
        firstName,
        lastName,
        email,
        password,
        imgPath
      });
      console.log('New User created:', response.data);
    } catch (error) {
      console.error('Error creating new User:', error);
    }
  };

  return (
    <section className="text-center text-lg-start">
      <style>
        {`
          .rounded-t-5 {
            border-top-left-radius: 0.5rem;
            border-top-right-radius: 0.5rem;
          }

          @media (min-width: 992px) {
            .rounded-tr-lg-0 {
              border-top-right-radius: 0;
            }

            .rounded-bl-lg-5 {
              border-bottom-left-radius: 0.5rem;
            }
          }
        `}
      </style>
      <div className="card mb-3">
        <div className="row g-0 d-flex align-items-center">
          <div className="col-lg-4 d-none d-lg-flex">
            <img
              src="https://mdbootstrap.com/img/new/ecommerce/vertical/004.jpg"
              alt="Trendy Pants and Shoes"
              className="w-100 rounded-t-5 rounded-tr-lg-0 rounded-bl-lg-5"
            />
          </div>
          <div className="col-lg-8">
            <div className="card-body py-5 px-md-5">
            <h2>Register</h2>
              <form onSubmit={handleSubmit}>
              <div class="row">
                <div class="col-md-6">
                    <div class="form-group">
                        <label for="firstName">First Name<span class="text-danger"> *</span>
                        <input type="text" id="firstName" className="form-control" required  value={firstName} onChange={(e) => setFirstName(e.target.value)}g/>
                        </label>
                    </div>
                </div>
                <div class="col-md-6">
                    <div class="form-group">
                        <label for="lastName">Last Name<span class="text-danger"> *</span>
                        <input type="text" id="lastName" className="form-control" required  value={lastName} onChange={(e) => setLastName(e.target.value)}g/>
                        </label>
                    </div>
                </div>
            <br/>
            </div>
                <div className="form-outline mb-4">
                 
                  <label className="form-label" htmlFor="email">
                    Email address
                    <input
                    type="email"
                    id="email"
                    className="form-control"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                  />
                  </label>
                </div>
                <div className="form-outline mb-4">
                 
                  <label className="form-label" htmlFor="password">
                    Password
                    <input
                    type="password"
                    id="password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    className="form-control"
                  />
                  </label>
                </div>
                <br/>
                <div className="form-outline mb-4">
                 
                 <label className="form-label" htmlFor="imgPath">
                 Image Path:
                   <input
                   type="text"
                   id="imgPath"
                   value={imgPath}
                   onChange={(e) => setImgPath(e.target.value)}
                   className="form-control"
                 />
                 </label>
               </div>

                <button
                  type="submit"
                  data-mdb-button-init
                  data-mdb-ripple-init
                  className="btn btn-primary btn-block mb-4"
                >
                  Register
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>

<br/>
<br/>
    </section>

  );
};

export default CreateUserForm;
